import React from "react";
import { Link } from "react-router-dom";



class ScoreList extends React.Component {
    constructor(props){
        super(props);
        this.state = {
            list: ['금','토','일','월','화','수','목'],
        }
    }

    render() {
        return (
            <div className ="scoreList">
                <p>금</p>
                <div className ="score" />
                <div className ="score" />
                <div className ="score" />
                <div className ="score" />
                <div className ="score" />
                <Link to="/edit">편집하기</Link>
            </div>
        )
    }
}

export default ScoreList;
